// The speed of the scroll in milliseconds
const speed = 800;
const offset = -70;

// Add smooth scrolling to all links
$('a[href*="#"]').on('click', function (event) {
    event.preventDefault();

    $('html, body').animate({
        scrollTop: $(this.hash).offset().top + offset
    }, speed);
});

var btn = $('#up-arrow');

$(window).scroll(function () {
    if ($(window).scrollTop() > 300) {
        btn.addClass('show');
    } else {
        btn.removeClass('show');
    }
});

btn.on('click', function (e) {
    e.preventDefault();
    $('html, body').animate({
        scrollTop: 0
    }, '300');
});

$(".ideas__element").click(function (event) {
    event.preventDefault()
    var src = $(this).attr("data-src")
    $('#modal-img__img').attr("src", src)
    $('#modal-img').modal('show')
})

$('#calculateModal').on('show.bs.modal', function (event) {
    var button = $(event.relatedTarget)
    var title = button.data('title')
    var yandexGoal = button.data('yandex')

    var modal = $(this)
    modal.find('#modal-header').text(title)
    modal.find('#modal-btn').text(title)
    modal.find('[name = yandex]').val(yandexGoal)

    if (yandexGoal == "catalog") {
        modal.find('#modal-text').text("   ,     !")
    }
})

